import leftBar from "./leftBar.scss";
import friends from "../../assets/friends.jpeg";

const LeftBar = () => {
    return (
        <div className="leftbar">
            <div className="container">
                <div className="menu">
                    <div className="user">
                        {/* <img src="https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" alt="" /> */}
                        <span>Raebo</span>
                    </div>
                    <div className="item">
                        <img src={friends} alt="" />
                        <span>Friends</span>
                    </div>

                </div>
            </div>

        </div>

    )
}

export default LeftBar
